import React from 'react'
import { useSelector } from 'react-redux';

const Customer = () => {

    const [seller,setSeller] = useState([]);

    useEffect(() => {
        setSeller(useSelector((state) => state.seller));
    }, [])


    console.log(seller);
    return (
        <div>
            <p>{seller} </p>
        </div>
    )
}

export default Customer
